  false,\n\t\"url\": null,\n\t\"notes\": \"Summary of a three year study, beginning
  in 2000 and lead by the Kansas Cooperative Fish and Wildlife Research Unit,  at
  Fort Niobrara National Wildlife Refuge to gather information to inform managers
  about the extent to which river recreation influences birds that depend on the river.
  Species of concern included neotropical migrants, resident songbirds using riparian
  forest and shrub, and river-associated birds. Our study goals were to 1) determine
  which species were sensitive to river recreation and 2) determine if there were
  thresholds of recreational disturbance for birds. Such biological information would
  help refuge managers decide what quantity and type of river recreation was compatible
  with their primary goal of protecting birds and their habitats.\",\n\t\"owner_org\":
